import TopNav from './TopNav';
import LeftNav from './LeftNav';
import MonRadio from './MonRadio';


function Page2() {
  return (
    <div >
        <TopNav />
        <LeftNav />
        <MonRadio />
        <li>
            <Link to="/Page1">Pageesss2 </Link>
        </li>


    </div>
  );
}

export default Page2;
